import "./styles.css";
import React, { useState } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { FormattedMessage } from "react-intl";
import { setGlobalLanguage } from "../../store/actionTypes";

const Navbar = (props) => {
  const [collapsedState, setCollapsedState] = useState(false);
  const navClass = collapsedState
    ? "collapse navbar-collapse show"
    : "collapse navbar-collapse";
  const togglerClass = collapsedState
    ? "navbar-toggler collapsed"
    : "navbar-toggler";
  const toggleNav = () => {
    setCollapsedState(!collapsedState);
  };

  const setLang = (e) => {
    props.setGlobalLanguage(e);
  };

  return (
    <nav className='app-navbar pl-5 pr-5 pt-2 pb-2 ml-auto mr-auto'>
      <ul className='d-flex justify-content-around align-items-center'>
        <li>
          <Link to='/' className='app-link'>
            <FormattedMessage id='home' />{" "}
            <span className='sr-only'>(current)</span>
          </Link>
        </li>
        <li>
          <Link to='/' className='app-link'>
            <FormattedMessage id='Skills' />{" "}
            <span className='sr-only'>(current)</span>
          </Link>
        </li>
        <li>
          <Link to='/' className='app-link'>
            <FormattedMessage id='Experience' />{" "}
            <span className='sr-only'>(current)</span>
          </Link>
        </li>
        <li>
          <Link to='/' className='app-link'>
            <FormattedMessage id='Education' />{" "}
            <span className='sr-only'>(current)</span>
          </Link>
        </li>
        <li>
          <Link to='/' className='app-link'>
            <FormattedMessage id='Contact' />{" "}
            <span className='sr-only'>(current)</span>
          </Link>
        </li>
        <li>
          <div class='btn-group'>
            <button
              type='button'
              class='btn btn-secondary btn-sm dropdown-toggle'
              data-toggle='dropdown'
              aria-haspopup='true'
              aria-expanded='false'
            >
              English
            </button>
            <div class='dropdown-menu'>
              <a class='dropdown-item'>English</a>
              <a class='dropdown-item'>German</a>
            </div>
          </div>
        </li>
      </ul>
    </nav>
  );
};

const mapStateToProps = (state) => {
  return {
    lang: state.languageReducer.lang,
  };
};

export default connect(mapStateToProps, { setGlobalLanguage })(Navbar);
